const int Npt_gk_2=31;
const int Npt_gk_3=63;
const int Npt_gk_4=127;
const int Npt_gk_5=255;
const int Npt_gk_6=511;
const int Npt_gk_7=1023;


//==================================================================
//the Kronrod and Legendre roots and weights initialized in arrays
//==================================================================
double root_gk_1[15],  weight_gk_1[15],  weight_gl_1[7];
double root_gk_2[31],  weight_gk_2[31],  weight_gl_2[15];
