//==================================
//Pointers to the roots and weights
//==================================
const int orderNum=7;
double *root_gk[orderNum]={root_gk_1, root_gk_2, root_gk_3, root_gk_4, root_gk_5, root_gk_6, root_gk_7};
double *weight_gk[orderNum]={weight_gk_1, weight_gk_2, weight_gk_3, weight_gk_4, weight_gk_5, weight_gk_6, weight_gk_7};
double *weight_gl[orderNum]={weight_gl_1, weight_gl_2, weight_gl_3, weight_gl_4, weight_gl_5, weight_gl_6, weight_gl_7};
int size[orderNum]={15, 31, 63, 127, 255, 511, 1023}; //Numbers of Kronrod roots and weights

// Main function body and Kronrod and Legendre Integrator Body
void f(double x_min, double x_max, double y_min, double y_max, double z_min, double z_max, double tol, int Npt, double * root_gk, double * weight_gk, double * weight_gl, bool & success, double & ans)
{
 //==========================================
 double max_m_min_x=0.5*(x_max-x_min); //Halfwidth of the lower and upper limits of x
 double max_p_min_x=0.5*(x_max+x_min); //Midpoint of the lower and upper limits of x
 //==========================================

 //========================================
 //x variable depdencies
 //========================================
 double x[Npt];
 std::memset(x,0,Npt*sizeof(double));
 for(int ix=0;ix<Npt;ix++){
  x[ix]=max_m_min_x*root_gk[ix]+max_p_min_x;
 }

 double x2[Npt];
 std::memset(x2,0,Npt*sizeof(double));
 for(int ix=0;ix<Npt;ix++){
  x2[ix]=x[ix]*x[ix];
 }

 //==========================================
 double max_m_min_y=0.5*(y_max-y_min); //Halfwidth of the lower and upper limits of y
 double max_p_min_y=0.5*(y_max+y_min); //Midpoint of the lower and upper limits of y
 //==========================================


 //=========================================
 // y variable depencies
 //=========================================

 double y[Npt];
 std::memset(y,0,Npt*sizeof(double));
 for(int iy=0;iy<Npt;iy++){
  y[iy]=max_m_min_y*root_gk[iy]+max_p_min_y;
 }

 double y3[Npt];
 std::memset(y3,0,Npt*sizeof(double));
 for(int iy=0;iy<Npt;iy++){
  y3[iy]=y[iy]*y[iy]*y[iy];
 }

 //==========================================
 double max_m_min_z=0.5*(z_max-z_min); //Halfwidth of the lower and upper limits of z
 double max_p_min_z=0.5*(z_max+z_min); //Midpoint of the lower and upper limits of z
 //==========================================


 //=========================================
 // z variable dependcies
 //=========================================
 double z[Npt];
 std::memset(z,0,Npt*sizeof(double));
 for(int iz=0;iz<Npt;iz++){
  z[iz]=max_m_min_z*root_gk[iz]+max_p_min_z;
 }

 double z4[Npt];
 std::memset(z4,0,Npt*sizeof(double));
 for(int iz=0;iz<Npt;iz++){
  z4[iz]=z[iz]*z[iz]*z[iz]*z[iz];
 }

 //=========================================
 // 3D Function to be Integrated
 //=========================================

 //==========================================
 //Gauss-Kronrod Loop
 //==========================================
 double ans_gk=0.0;
 #pragma omp parallel for reduction(+:ans_gk)// Pragma for Multithread Parallelization. Comment it off if not needed.
 for(int ix=0;ix<Npt;ix++){
        for(int iy=0;iy<Npt;iy++){
                //#pragma omp simd // Pragma for internal loop possible vectorization hint. Comment it off if not needed.
                for(int iz=0;iz<Npt;iz++){
                    double arg = std::erf(x[ix]*x[ix] + y[iy]*y[iy]+ z[iz]*z[iz]) ;// Write the function here. Use x[ix],y[iy], z[iz] for pointer marking.
                    ans_gk+=weight_gk[ix]*weight_gk[iy]*weight_gk[iz]*arg;
                }
        }
 }
 ans_gk*=max_m_min_x*max_m_min_y*max_m_min_z;


//==========================================
//Gauss-Legendre Loop
//==========================================
 if(Npt<=Npt_gk_7){
  int Npt_gl=(Npt-1)/2;
  double ans_gl=0.0;
  //#pragma omp parallel for reduction(+:ans_gl)// Pragma for Multithread Parallelization. Comment it off if not needed.
  for(int ix=0;ix<Npt_gl;ix++){
        for(int iy=0;iy<Npt_gl;iy++){
                //#pragma omp simd // Pragma for internal loop possible vectorization hint. Comment it off if not needed.
                for(int iz=0;iz<Npt_gl;iz++){
                    double arg =  std::erf(x[2*ix+1]*x[2*ix+1] + y[2*iy + 1]*y[2*iy+1] + z[2*iz+1]*z[2*iz+1]) ;// Repeat the function here. Use x[2*ix+1],y[2*iy+1], z[2*iz+1] for proper pointer marking.
                    ans_gl+=weight_gl[ix]*weight_gl[iy]*weight_gl[iz]*arg;
                }
        }
  }
  ans_gl*=max_m_min_x*max_m_min_y*max_m_min_z;


//==========================================
//Precision and Tolerance Relation
//==========================================
  ans=0.0;
  double rel_diff=std::abs((ans_gl-ans_gk)/ans_gk);
  if(rel_diff<tol){
   success=true;
   ans=ans_gl;
   printf("The function converged with %d points giving %.10e!\n", Npt, ans);
  }
  else{
   success=false;
   printf("The function didn't converge with %d points. Moving to the next order.\n", Npt);
  }
 }
 else{
   success=true;
   ans=ans_gk;
 }
}

//==========================================
//Convergence and Pointwise loop
//==========================================
void converged_f(double x_min, double x_max, double y_min, double y_max, double z_min, double z_max, double tol, double & ans)
{
 ans=0.0;
 bool success=false;// Systematically going through each order
 f(x_min, x_max, y_min, y_max, z_min, z_max, tol, Npt_gk_1, root_gk_1, weight_gk_1, weight_gl_1, success, ans);

 if(success==false){
  printf("starting order Npt_gk=%d\n",Npt_gk_2);
  f(x_min, x_max, y_min, y_max, z_min, z_max, tol, Npt_gk_2, root_gk_2, weight_gk_2, weight_gl_2, success, ans);
  if(success==true){printf("ans=%.10e\n",ans);}
 }
 if(success==false){
  printf("starting order Npt_gk=%d\n",Npt_gk_3);
  f(x_min, x_max, y_min, y_max, z_min, z_max, tol, Npt_gk_3, root_gk_3, weight_gk_3, weight_gl_3, success, ans);
  if(success==true){printf("ans=%.10e\n",ans);}
 }
 if(success==false){
  printf("starting order Npt_gk=%d\n",Npt_gk_4);
  f(x_min, x_max, y_min, y_max, z_min, z_max, tol, Npt_gk_4, root_gk_4, weight_gk_4, weight_gl_4, success, ans);
  if(success==true){printf("ans=%.10e\n",ans);}
 }
 if(success==false){
  printf("starting order Npt_gk=%d\n",Npt_gk_5);
  f(x_min, x_max, y_min, y_max, z_min, z_max, tol, Npt_gk_5, root_gk_5, weight_gk_5, weight_gl_5, success, ans);
  if(success==true){printf("ans=%.10e\n",ans);}
 }
 if(success==false){
  printf("starting order Npt_gk=%d\n",Npt_gk_6);
  f(x_min, x_max, y_min, y_max, z_min, z_max, tol, Npt_gk_6, root_gk_6, weight_gk_6, weight_gl_6, success, ans);
  if(success==true){printf("ans=%.10e\n",ans);}
 }
 if(success==false){// If it doesnt converge by 1023, the 1023 Gauss-Kronrod ans is taken as the final answer
  printf("starting order Npt_gk=%d\n",Npt_gk_7);
  f(x_min, x_max, y_min, y_max, z_min, z_max, tol, Npt_gk_7, root_gk_7, weight_gk_7, weight_gl_7, success, ans);
  if(success==true){printf("ans=%.10e\n",ans);}
 }
}

